import React, { FC, useState } from "react";
import { Container, Row, Button } from "react-bootstrap";
import { photoAPI } from "../services/PhotoService";
import { IPhoto, IOption } from "../models/types";
import PhotoItem from "../components/items/PhotoItem";
import MySelect from "../components/ui/select/MySelect";
import PaginationButtons from "../components/ui/PaginationButtons";

const PhotoApiPage = () => {
  const { data: photos, error, isLoading } = photoAPI.useFetchAllPhotoQuery();

  const handleUpdate = () => {};
  const handleRemove = () => {};

  return (
    <Container className="card mt-6">
      <Row>
        {photos && (
          <div>
            <h3 className="textCenter">Список фоток из photoAPI</h3>
          </div>
        )}

        {photos &&
          photos.map((photo) => <PhotoItem key={photo.id} photo={photo} update={handleUpdate} remove={handleRemove} />)}
      </Row>
    </Container>
  );
};

export default PhotoApiPage;
